  \"2015-02-04T19:16:31.970011\",\n\t\"name\": \"prevention-quality-indicator-pqi-composite-measure-rates-by-county-2008-2012-a6bc4\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Rate per 100,000; rates are adjusted for
  age and sex.nnPQI measures are used to monitor performance over time or across regions
  and populations using patient data found in a typical hospital discharge abstract.
  PQI measures can be used to summarize quality across multiple indicators, improve
  ability to detect differences, identify important domains and drivers of quality,
  prioritize action for quality improvement, make current decisions about future and
  unknown health care needs. nOverall Composite (PQI #90) is comprised of: all PQI
  measures within the Chronic and Acute Composites.nnChronic Composite (PQI #92) is
  comprised of: PQI #01 Diabetes Short-Term Complications Admission Rate, PQI #03
  Diabetes Long-Term Complications Admission Rate, PQI #05 Chronic Obstructive Pulmonary
  Disease (COPD) or Asthma in Older Adults Admission Rate, PQI #07 Hypertension Admission
  Rate, PQI #08 Congestive Heart Failure (CHF) Admission Rate, PQI #13 Angina without
  Procedure Admission Rate, PQI #14 Uncontrolled Diabetes Admission Rate, PQI #15
  Asthma in Younger Adults Admission Rate, PQI #16 Rate of Lower-Extremity Amputation
  Among Patients With Diabetes, nnAcute Composite (PQI #91) is comprised of: PQI #10
  Dehydration Admission Rate, PQI #11 Bacterial Pneumonia Admission Rate, and PQI
  #12 Urinary Tract Infection Admission Rate.\",\n\t\"license_title\": \"License Not
